import { Injectable } from '@angular/core';
import { SignedTransaction } from 'tsjs-xpx-chain-sdk';
import { Subscription } from 'rxjs';
import { DataBridgeService } from '../../../../shared/services/data-bridge.service';
import { SharedService } from '../../../../shared/services/shared.service';

@Injectable({
  providedIn: 'root'
})
export class ApostilleService {

  blackListTransaction: SignedTransaction[] = [];
  subscription: Subscription[] = [];
  whiteListTransaction: SignedTransaction[] = [];

  constructor(
    private dataBridge: DataBridgeService,
    private sharedService: SharedService
  ) { }


  /**
   * Get certificate public
   *
   * @returns
   * @memberof ApostilleService
   */
  getCertificatePublic() {
    const cert = 'data:image/jpeg;base64,';
    return cert;
  }

  /**
   *
   *
   * @returns
   * @memberof ApostilleService
   */
  getCertificatePrivate() {
    const rsp = 'data:image/jpeg;base64,';
    return rsp;
  }

  /**
   *
   *
   * @memberof TransactionsService
   */
  getTransactionStatus() {
    // Get transaction status
    this.subscription.push(this.dataBridge.getTransactionStatus().subscribe(
      statusTransaction => {
        if (statusTransaction !== null && statusTransaction !== undefined && this.whiteListTransaction !== null) {
          for (let element of this.whiteListTransaction) {
            const statusTransactionHash = (statusTransaction['type'] === 'error') ? statusTransaction['data'].hash : statusTransaction['data'].transactionInfo.hash;
            const match = statusTransactionHash === element.hash;
            if (match) {
              this.blackListTransaction.push(element);
            }

            if (statusTransaction['type'] === 'confirmed' && match) {
              this.whiteListTransaction = this.whiteListTransaction.filter(el => el.hash !== statusTransactionHash);
              this.sharedService.showSuccess('', 'Transaction confirmed');
            } else if (statusTransaction['type'] === 'unconfirmed' && match) {
              this.sharedService.showInfo('', 'Transaction unconfirmed');
            } else if (match) {
              this.whiteListTransaction = this.whiteListTransaction.filter(el => el.hash !== statusTransactionHash);
              this.sharedService.showWarning('', statusTransaction['data'].status.split('_').join(' '));
            }
          }
        }
      }
    ));
  }
}
